import gitstatus from './gitstatus';

class App extends Component{

	state = {
		status: [],
	}

	async componentDidMount(){
		const response = await gitstatus.get('');
		console.log(response.data);
		this.setState({status: response.data});
	}

	render(){
		return(
			<div>
			Status do GitHub
			</div>
			);
	};
};
